/**
 * @param {number[]} nums
 * @param {number} k
 * @param {number} dist
 * @return {number}
 */
var minimumCost = function(nums, k, dist) {
    const n = nums.length;
    const dp = new Array(k).fill(0).map(() => new Array(n).fill(Infinity));
    for (let i = 0; i < n; i++) dp[0][i] = nums[i];

    for (let i = 1; i < k; i++) {
        for (let j = i; j < n; j++) {
            for (let m = i - 1; m <= j - 1 && j - m <= dist + 1; m++) {
                dp[i][j] = Math.min(dp[i][j], dp[i - 1][m] + nums[j]);
            }
        }
    }

    let answer = Infinity;
    for (let i = k - 1; i < n; i++) {
        answer = Math.min(answer, dp[k - 1][i]);
    }
    return answer;
};
